import React, { useEffect, useState} from "react";
import { useParams } from "react-router-dom";
import axios from 'axios';
import { Formik, Form, Field, ErrorMessage } from "formik"
import { useNavigate } from "react-router-dom";
import { useFormik } from "formik";
import Modal from '@mui/material/Modal'
import Box from '@mui/material/Box'


function PatientsDetail () {
    let navigate = useNavigate(); 
    let { id } = useParams();
    const [patientObject, setPatientObject] = useState({});
    const [levels, setlevels] = useState([]);

    const [open, setOpen] = useState(false);
    const handleOpen = () => setOpen(true);
    const handleClose = () => setOpen(false);

    const initialValues = {
        bloodSugarLevel: 0,
        weight: 0,
        cholesterol: 0,
        hemoglobin: 0,
        systolicBloodPressure: 0,
        diastolicBloodPressure: 0,
    }

    const onSubmit = (data) => {
        axios.post("http://localhost:3001/levels", data). then((response) => {
            
        })
    }


    useEffect(() => {
        axios.get(`http://localhost:3001/patientsinfo/byId/${id}`).then((response) => {
            setPatientObject(response.data);
            console.log(response.data);
    }); 
        axios.get(`http://localhost:3001/levels/${id}`).then((response) => {
            setlevels(response.data);
            console.log(response.data);
    }); 
}, []);

 

    return(
        <section>
            <div className="font-bold uppercase p-10">
                {patientObject.id} , {patientObject.firstName} , {patientObject.lastName}
            </div>
            <div className="flex flex-row flex-wrap" >
                {levels.map((level, key) => {
                    return(
                    <div className="p-10">
                        <div className="flex-col">
                            <p>{patientObject.createdAt}</p>
                            <p>
                                {level.bloodSugarLevel} | Blood Sugar Level
                            </p>
                            <p>
                                {level.weight} | Weight
                            </p>
                            <p>
                                {level.cholesterol} | Cholesterol Level
                            </p>
                            <p>
                                {level.hemoglobin} | Hemoglobin Level
                            </p>
                            <p>
                                {level.systolicBloodPressure} | Systolic Level
                            </p>
                            <p>
                                {level.diastolicBloodPressure} | Diastolic Level
                            </p>
                        </div>
                    </div>
                    )
                })}
            </div>
            <div>
                <button onClick={handleOpen}>
                    Add New Category
                </button>
                <Modal
                    size="lg"
                    aria-labelledby="contained-modal-title-vcenter"
                    centered
                    onHide={handleClose}
                >
                    <form onSubmit={handleSubmit}>
                    <div>
                        <label className="m-4 font-weight-bolder" htmlFor="categoryName">
                        Categories Name
                        </label>
                        <input
                        id="categoryName"
                        name="categoryName"
                        type="string"
                        className="border border-dark rounded-top w-75"
                        onChange={formik.handleChange}
                        value={formik.values.categoryName}
                        />
                        <br></br>
                        <label className="m-4 font-weight-bolder" htmlFor="imageUrl">
                        Categories Image
                        </label>
                        <input
                        id="imageUrl"
                        name="imageUrl"
                        type="string"
                        className="border border-dark rounded-top w-75"
                        onChange={formik.handleChange}
                        value={formik.values.imageUrl}
                        />
                    </div>
                    <div>
                        <button onClick={handleClose}>
                        Close
                        </button>
                        <button variant="success" type="submit" onClick={handleClose}>
                        Submit
                        </button>
                    </div>
                    </form>
                </Modal>
                </div>
        </section>
    )
}

export default PatientsDetail
